import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The view mode buttons only appear on a category or search results page.
    // First, click on a category to navigate to a page with the view toggle.
    const electronicsCategoryCard = page.locator('.category-card', { hasText: 'Electronics' });
    await electronicsCategoryCard.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsCategoryCard.click();

    // Wait for the view toggle controls to be visible
    await page.waitForSelector('.view-toggle', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page_grid_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page_grid_view.png'));

    // Find and click the "List View" button using its title attribute
    const listViewButton = page.getByTitle('List View');
    await listViewButton.waitFor({ state: 'visible', timeout: 5000 });
    await listViewButton.click();

    // Wait for the product container to switch to the 'products-list' class
    await page.waitForSelector('.products-list', { state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view_active.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view_active.png'));

    // Extract data to verify the switch was successful
    const isListViewApplied = await page.locator('.products-list').isVisible();
    const buttonClass = await listViewButton.getAttribute('class');
    const isButtonActive = buttonClass.includes('active');

    if (!isListViewApplied || !isButtonActive) {
      throw new Error('Failed to switch to List View or the button did not become active.');
    }

    return {
      success: true,
      action: "Switched to List View Mode",
      extractedData: {
        viewModeContainerClass: 'products-list',
        isListViewApplied: isListViewApplied,
        isButtonActive: isButtonActive
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
